import React from 'react';
import './App.css';
import { Container, Nav } from "react-bootstrap";
import ReactFC from "react-fusioncharts";
// fusioncharts
import FusionCharts from "fusioncharts";
import Charts from "fusioncharts/fusioncharts.charts";
import Maps from "fusioncharts/fusioncharts.maps";
import USARegion from "fusionmaps/maps/es/fusioncharts.usaregion";
ReactFC.fcRoot(FusionCharts, Charts, Maps, USARegion);

function App() {
  return (
    <Container>
      {/* static navbar - top */}
      <Nav className="navbar navbar-expand-lg fixed-top is-white is-dark-text">
        <Container className="navbar-brand h1 mb-0 text-large font-medium">
          Online Retail Dashboard
        </Container>
        <Container className="navbar-nav ml-auto">
          <Container className="user-detail-section">
            <span className="pr-2">Hi, Sean</span>
            <span className="img-container">
              </span>
          </Container>
        </Container>
      </Nav>

      {/* static navbar - bottom */}
      <Nav className="navbar fixed-top nav-secondary is-dark is-light-text">
        <Container className="text-medium">Summary</Container>
        <Container className="navbar-nav ml-auto">
        </Container>
      </Nav>

      {/* content area start */}
      <Container className="container-fluid pr-5 pl-5 pt-5 pb-5">
        <Container className="row">

        </Container>
        <Container className="row">

        </Container>
        <Container className="row">
          <Container className="col-md-6 mb-4">
            <Container className="card is-card-dark chart-card">
              <Container className="chart-container large full-height">
                <ReactFC
                  {...{
                    type: "bar2d",
                    width: "100%",
                    height: "100%",
                    dataFormat: "json",
                    containerBackgroundOpacity: "0",
                    dataEmptyMessage: "Loading Data...",
                    dataSource: {
                      chart: {
                        theme: "ecommerce",
                        caption: "Orders Trend",
                        subCaption: "By Stores"
                      },
                      data: [{
                        label: "Test1",
                        value: 20,
                        displayValue: 20
                      }, {
                        label: "Test2",
                        value: 20,
                        displayValue: 20
                      }]
                    }
                  }}
                />
              </Container>
            </Container>
          </Container>
        </Container>
      </Container>
    </Container>
  );
}

export default App;
